import React from "react";
import human from "../../../Image/human.jpg";
import "./Profil.css";
import ListProfile from "./ListProfile";

class Profil extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="wrapp">
        <nav class="navbar profile">
          <a class="navbar-brand" href="##">
            <img className="image-profile" src={human} width="50" height="50" alt="" />
          </a>
<div class="btn-group">
  <i class="fa fa-bars  dropdown-toggle" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">

  </i>
  <div class="dropdown-menu">
    <a class="dropdown-item" href="#">Action</a>
    <a class="dropdown-item" href="#">Another action</a>
    <a class="dropdown-item" href="#">Something else here</a>
    <div class="dropdown-divider"></div>
    <a class="dropdown-item" href="#">Separated link</a>
  </div>
</div>
          {/* <div className="navbar-nav">
            <i className="fa fa-bars icon"
            style={{fontSize: "25px"}}
            ></i>
          </div> */}
        </nav>
        <div class="form-group has-search">
          <span class="fa fa-search form-control-feedback"></span>
          <input
            type="text"
            class="form-control shadow-none"
            placeholder="Search Your Contact . . ."
          />
        </div>
        <div className="list-profile">
          <ListProfile />
        </div>
      </div>
    );
  }
}

export default Profil;
